import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import cardStuff from './cards.jsx';
import {Button, Container, Col, Row, } from 'react-bootstrap'

function App() {
  return (
    <div className="App">
      <header className='App-header'>
      <Button1 />
      </header>
      <body>

          <cardStuff></cardStuff>
          <cardStuff></cardStuff>
      </body>
    </div> 
  );
}

function Button1() {
  return (
  <div>
  <Button>Did this work Scott???</Button>
  </div>
  );
}

function cards() {
  return (


   <Card className='mb-3' style={{ color: "#000" }}>

       <Card.Body>
           <Card.Title>
               About
           </Card.Title>          
       </Card.Body>
   </Card>
  );
}
export default App;
